import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const Note = (props) => {
    return (
        <>
            <div className = "container adjust">
            <div className = "disp noteHeading" style = {{border : "2px solid"}}>
                <h4>{props.itemTitle}</h4>
                <p>{props.itemContent}</p>
            </div>
            </div>
        </>
    );
}

export default Note;
